import React from "react";
import "../App.css";
import {Card} from 'react-bootstrap';

function Dashboard() {
  return (
    <div className="dashboard">
      <h1 className="dashboard">Dashboard page</h1>
      <Card className="ml-5 mr-5" style={{ width:'18rem' }}>
        <Card.Body>
          <Card.Title>This is dashboard card</Card.Title>
        </Card.Body>
      </Card>

    </div>
  );
}
export default Dashboard;
